import store from "../../redux/state";
import classes from './Header2.module.css';

const Header2 = () => {
    return(
        <header className={classes.header}>
            <div><b><h3>Привет {store._state.ProfileInfo[0].Firstname}!</h3></b> МОИ ФОТО</div>

      </header>
    )
}

export default Header2;
